import ExpenseItem from "./components/ExpenseItem/ExpenseItem";
import List from "./components/List/List";

function App() {

  const rarityList = []

  fetch('http://reshade.io:1234')
  .then(response => response.json())
  .then(data => {
    rarityList = Object.values(data);
    console.log(data); // JSON data retrieved from the URL
  })
  .catch(error => {
    console.log('Error:', error);
  });

  const expenses= [
    {title:'Ak-47 : Case Hardened',amount:300,date: new Date(2023,5,16)},
    {title:'AWP:Dragon Lore',amount:15000,date: new Date(2023,5,16)},
    {title:'M4A1 : Desolate Space',amount:50,date: new Date(2023,5,16)}
  ]



  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem title={expenses[0].title} amount={expenses[0].amount} date={expenses[0].date}></ExpenseItem>
      <ExpenseItem title={expenses[1].title} amount={expenses[1].amount} date={expenses[1].date}></ExpenseItem>
      <ExpenseItem title={expenses[2].title} amount={expenses[2].amount} date={expenses[2].date}></ExpenseItem>
      <p>-------------------------</p>
      <List rarity={rarityList[0].rarity} hexCode={rarityList[0].hexCode}></List>
      <List rarity={rarityList[1].rarity} hexCode={rarityList[1].hexCode}></List>
      <List rarity={rarityList[2].rarity} hexCode={rarityList[2].hexCode}></List>
      <List rarity={rarityList[3].rarity} hexCode={rarityList[3].hexCode}></List>
      <List rarity={rarityList[4].rarity} hexCode={rarityList[4].hexCode}></List>
      <List rarity={rarityList[5].rarity} hexCode={rarityList[5].hexCode}></List>
      <List rarity={rarityList[6].rarity} hexCode={rarityList[6].hexCode}></List>
    </div>
  );
}

export default App;
